function App() {
  return (
    <div className="App">
      <h1>ToDo</h1>
      <div className='topPanel'>
        <div className='inputTask'>
          {/* <input className='inputTask2' type="text" placeholder="i want to..."> */}
        </div>
        <div className='controlPanel'>
          <div className='sortPanel'>
            <button className="floating-button">All</button>
            <button className="floating-button">Done</button>
            <button className="floating-button">Undone</button>
          </div>
          <div className='sortDatePanel'>
            Sort by date
            <button className="floating-button">⇧</button>
            <button className="floating-button">⇩</button>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
